  input: 'TEXT,F3PA,,"I was unable to meet the deadline for submitting an amended
    report (due on September 9th).  There were several circumstances surrounding this.  Our
    previous Treasurer, Lorrie Kopp, resigned on August 19th, 2004.  When she turned
    over the FEC data files, we built the Aug 20 report on top of this data.  We only
    just recently discovered that the file was not complete, and that the file that
    was submitted was ''hidden''.  We have located that file and amended on top of
    that.  On last Thrusday, while attempting to enter correcting entries, the program
    failed multiple times.  According to your tech support, there is a known bug with
    adding receipts for a Presidential committee, and the only weay to add lines is
    through a (to this user) obscure method.  Each time the program blew up, I lost
    other data changes, so did not meet the Sep 9 deadline.  I called on Friday and
    got corrective instructions.   On MOnday Sep 13, I again got messages that told
    that errors existed, but did not identify what the error was (Field #198 missing).  Because
    I enocuntered this error after your closing time, I was not able to mitigate this
    until today.  Geoffrey Neale, Operastions Manager, Badnarik for President."'
